import React from 'react';

import '../App.css';

const SponsorCard = ({ props }) => {

  return (
    <div className='SingleCard'>
      <div>
        <img src={'https://lh3.googleusercontent.com/NWfbsppj8G7QGKR2mg7LveL6NoijyglYKPRlRb1dXYHUffYjxytOboAxdO-dA7yynP5SZ-LJ37n8dPtV1JHmKxfhtYDOByBQZ5ZNLzBMTYfUqCjCrbfgDhfxTucnN356xdTKqP60535Z0SzxJFUNpPFHvHdIEAB8HDBnuaaf0efhoSU0ftcY_9p-qJPOL_fRnAnriFBzlshadMmPSVWU25FjRbpEpMMqy9L-TiZT_cbqE3l4oSi3un-VsWCflNPW_X-LtI3DzCG_oOoR-bgOx6f-HOdeEueMgLplDlBbK9XkWY8wBnIsy7oNi9iKyEjHNI1LDlUW7dLBkxT4sZYnMgFwikqWn-jCsnSD_Pn9EDTb7RptvxOzXMAm_tZPlHAUEuTfu7gmDKitbg6fVW5KMmLS8E8KKqYNQhvgq7ANWXnjg4vC2Sb5ru0ihQ3fKt9q_npghkpG5SdY9AQ0JaJmYZUdMOV0j28oHUEu9GbgeR4GuTT_YLs7-dZ9iJqOeUhJBHroNMFeLyiQ3BdSKdrWaCsJuSAqw7uDtcaWTJH0JkkVJo3FLBl2AjkneWwnXoGNKXgohlg0JOkgvnS3H74Yx2fe4bYV2rkW=w483-h643-no'} className="SponsorCardImage" alt={props.SponsorEng} />
      </div>

      <div className='CardTitle'>
        <h5>
        <a href={props.Web} target="_blank" rel="noopener noreferrer" className='SponsorWeb'>{props.SponsorEng}</a>
        </h5>
        <h5>
          {props.SponsorChn}
        </h5>
      </div>
    </div>
  )
}

export default SponsorCard
